export default class Inputwithimagefix extends Component {
    render() {
        return (
            <>
                 <div className='conatiner-fluid mt-2'>
                       <div className='row'>
                            
                                    {/* <img src={img1} alt='error' className='imgs'/> */}
                          <div className='first'>
                                 {/* <div className='second'> */}
                                        <div className='container'>
                                                   {/* <div className='col-md-7'> */}
                                                         <div className='row mt-5'>
                                                              <h1 className='text-white'>Choose, Order and Checkout</h1>
                                                         </div>
                                                         <div className='row mt-4'>
                                                              <p className='text-white'>Specify your address to suggest you the fast delivery</p><br/>
                                                              {/* <div className='text-white'> Get our services from 24 hours.</div>  */}

                                                         </div>
                                                         <div className='row'>
                                                               <p className='text-white'> Get our services from 24 hours.</p>
                                                         </div>
                                                         <div className='row mt-4'>
                                                                    <button className='btn btn-warning text-white p-2'>Go To Meal</button>
                                                         </div>
                                                        
                                                   {/* </div> */}
                                                   {/* <div className='col-md-5'> */}
                                                           <div className='main'>
                                                                  <input type='text' className='form-control mt-5' placeholder='Choose Your Location'/>
                                                                  <input type='text' className='form-control mt-2  ' placeholder='choose  resturant'/>
                                                                  <button className='btn btn-warning bt mb-4'>Find Food</button>
                                                           </div>
                                                    {/* </div>   */}
                                                 
                                                
                                               
                                        </div>
                                                  
                                       
                                 {/* </div> */}
                          </div>
                             
                       </div>
                      
                 </div>
            </>
        )
    }
}
